import React, { Component } from 'react';
import { MenuItems } from "./MenuItems";
import './Navbar.css';

class Navbar extends Component{
    state = { clicked: false } 



    render() {
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo"><img src={require('../../assets/img/logo192.png')} style={{width: "80px", height: "80px"}}/></h1>
                <div className="menu-icon" onClick={this.state}>
                    
                </div>
                <ul>
                    {MenuItems.map((item, index)=> {
                        return (
                            <li key={index}>
                                <a className={item.cName} href={item.url}>
                                    {item.title}
                                </a>
                            </li>
                        )
                    })}
                </ul>
            </nav>
        )
    }
}

export default Navbar
